INSERT INTO `article` VALUES (1,200,9999,'各位排序算法实际测试结果','OS: winxp, Compiler: vc8, CPU：Intel T7200,  Memory: 2G<br>\r\n不同数组长度下调用6种排序1000次所需时间(秒）<br>\r\n<br>\r\n<pre style=\"display:inline\">\r\nlength          shell           quick           merge           insert          select          bubble\r\n100             0.0141          0.359           1.875           0.204           0.313           0.421\r\n1000            0.218           0.578           2.204           1.672           2.265           4\r\n5000            1.484           3.25            14.14           41.392          63.656          101.703\r\n10000           3.1             7.8             23.5            253.1           165.6           415.7\r\n50000           21.8            40.6            121.9           411.88          6353.1          11648.5\r\n100000          53.1            89              228.1           16465.7         25381.2         44250\r\n</pre>\r\n<br>\r\n<br>\r\n结论：<br>\r\n数组长度不大的情况下不宜使用归并排序，其它排序差别不大。<br>\r\n数组长度很大的情况下Shell最快，Quick其次，冒泡最慢。<br>','2013-06-02 02:25'),(50,102,9999,'java之javaee官方文档','http://docs.oracle.com/javaee/6/api/','2013-04-17 13:15'),(51,102,9999,'java之javase官方文档','http://docs.oracle.com/javase/7/docs/api/index.html','2013-04-18 02:38'),(52,102,9999,'jQuery UI Layout Plug-in','http://layout.jquery-dev.net/','2013-04-18 02:53'),(54,102,9999,'jQuery Form Plugin','http://www.malsup.com/jquery/form/','2013-04-18 02:06'),(55,102,9999,'jQuery官方文档','http://api.jquery.com/','2013-04-18 02:17'),(56,102,9999,'jQuery之easyui官方文档','http://api.jqueryui.com/','2013-04-18 02:30'),(57,102,9999,'Getting Started with Rails','http://guides.rubyonrails.org/getting_started.html','2013-04-18 02:42'),(58,102,9999,'Getting Started with Cloud Foundry','http://docs.cloudfoundry.com/getting-started.html','2013-04-18 02:52'),(59,101,9999,'改变自己','改变自己，从接触他人开始。加油！','2013-04-18 02:58'),(60,102,9999,'CloudFoudry环境搭建','http://docs.cloudfoundry.com/getting-started.html','2013-04-18 03:07'),(61,101,9999